import React, {Component} from 'react';
import NumberButton from './numberButton';
import { MainScreen } from './mainScreen';
import { BackButton } from './backButton';
import { EqualsButton } from './equalsButton';

class NumberPanel extends Component {


    render() {
        return (
            <div>
                <div>
                    <MainScreen/>
                </div>
            <div>
                <NumberButton name="1"/>
                <NumberButton name="2"/>
                <NumberButton name="3"/>
            </div>
            <div>
                <NumberButton name="4"/>
                <NumberButton name="5"/>
                <NumberButton name="6"/>
            </div>
            <div>
                <NumberButton name="7"/>
                <NumberButton name="8"/>
                <NumberButton name="9"/>
            </div>
            <div>
                <BackButton/>
                <NumberButton name="0"/>
                <EqualsButton/>
            </div>
        </div>
        );
    }
}

export default NumberPanel;
